def isValid(board, row, col, num):
    # Check if number already present in row
    for x in range(9):
        if board[row][x] == str(num):
            return False

    # Check if number already present in column
    for x in range(9):
        if board[x][col] == str(num):
            return False

    # Check if number already present in 3x3 grid
    start_row = row - row % 3
    start_col = col - col % 3
    for i in range(3):
        for j in range(3):
            if board[i + start_row][j + start_col] == str(num):
                return False

    return True


def solveSudoku(board):
    for i in range(9):
        for j in range(9):
            if board[i][j] == '.':
                for num in range(1, 10):
                    if isValid(board, i, j, num):
                        board[i][j] = str(num)
                        if solveSudoku(board):
                            return True
                        else:
                            # Remove number when backtracking
                            board[i][j] = '.'
                return False

    return True


# Example usage:
board = [
    ['5', '3', '.', '.', '7', '.', '.', '.', '.'],
    ['6', '.', '.', '1', '9', '5', '.', '.', '.'],
    ['.', '9', '8', '.', '.', '.', '.', '6', '.'],
    ['8', '.', '.', '.', '6', '.', '.', '.', '3'],
    ['4', '.', '.', '8', '.', '3', '.', '.', '1'],
    ['7', '.', '.', '.', '2', '.', '.', '.', '6'],
    ['.', '6', '.', '.', '.', '.', '2', '8', '.'],
    ['.', '.', '.', '4', '1', '9', '.', '.', '5'],
    ['.', '.', '.', '.', '8', '.', '.', '7', '9']
]

if solveSudoku(board):
    for row in board:
        print(row)
else:
    print("No solution exists")
